import Frutas from './components/Frutas'

const App = () => {


    const saludo ='saludo'


    const clasesObjeto = {
        primary: "text-primary",
        danger: "text-danger"
    }

    const user = true
    

    const SaludoBienvenida = () => {
        return (
        <h2 className="text-success">Bienvenido!</h2>
        );
    };

    const SaludoDespedida = () =>{

        return(
        <h2 className="text-danger">Good Bye!</h2>

        );
    };

    const funcionClick = (nombre) => {
        console.log(`click ${nombre}`);
    }


    return (
        <div className="container">
            
            <p className={clasesObjeto.primary}>{saludo}</p>

            {user ? < SaludoBienvenida /> : < SaludoDespedida />}
             
            <Frutas />

            <button
                className="btn btn-primary"
                //onClick={()=> console.log("me diste click")}
                onClick={()=> funcionClick("bluuweb")}
                >
                     dame click 

            </button>
            </div>

           
    );
};

export default App;
